
function audioplayer(ty, input, onReady) {
    var sys = (window.AudioContext || window.webkitAudioContext);
    var ctx = new sys();
    var sampleRate = 44100;
    var durationInSeconds = 1;

    if (ty === "pianoRender") {
        let parts = input.split(";");
        let last = parts[parts.length - 1];
        durationInSeconds = parseInt(last.split(",")[3], 16) / 1000 + 2; // add padding
    }

    var offlineCtx = new OfflineAudioContext(1, sampleRate * durationInSeconds, sampleRate);

    var state = {
        buf: null,
        node: null,
        flag: false,
        stopped: false,
        marker: 0,
        origin: 0,
        pianoNotes: {
            36: "data:audio/wav;base64,",
            60: "data:audio/wav;base64,",
            84: "data:audio/wav;base64,"
        },
        decodedNotes: {

        },
    };
    function load(b64){
        console.log(b64)
        var raw = b64.split(",")[1];
        var bin = atob(raw);
        var temp = new Uint8Array(bin.length);
        for (var i = 0; i < bin.length; i++){
            temp[i] = bin.charCodeAt(i);
        }
        ctx.decodeAudioData(temp.buffer, function(b){
            state.buf = b;
        },
        function(e){
            console.log(e);
        });

    }
    function decodeNote(b64, cb) {
        var raw = atob(b64.split(",")[1]);
        var bin = new Uint8Array(raw.length);
        for (var i = 0; i < raw.length; i++) bin[i] = raw.charCodeAt(i);
        ctx.decodeAudioData(bin.buffer, function(buffer) {
            cb(null, buffer);
        }, function(err) {
            cb(err);
        });
    }

    function loadNotes(callback) {
        var keys = Object.keys(state.pianoNotes).map(Number);
        var loaded = 0;
        keys.forEach((key) => {
            decodeNote(state.pianoNotes[key], function(err, buffer) {
                if (!err) state.decodedNotes[key] = buffer;
                loaded++;
                if (loaded === keys.length) callback();
            });
        });
    }

    function decodeMidi(midiData) {
        return midiData.split(";").map(entry => {
            const [m, v, d, t] = entry.split(",").map(x => parseInt(x, 16));
            return {
                midi: m,
                velocity: v / 100,
                duration: d / 100,
                time: t / 1000
            };
        });
    }

    function scheduleOfflineMidi(midiData, ctx, decodedNotes) {
        let notes = decodeMidi(midiData);
        notes.forEach(note => {
            const { midi, velocity, duration, time } = note;
            const available = Object.keys(decodedNotes).map(Number);
            const closest = available.reduce((a, b) => Math.abs(b - midi) < Math.abs(a - midi) ? b : a);
            const buf = decodedNotes[closest];
            if (!buf) return;

            const src = ctx.createBufferSource();
            src.buffer = buf;
            src.playbackRate.value = Math.pow(2, (midi - closest) / 12);

            const gain = ctx.createGain();
            gain.gain.value = velocity;

            src.connect(gain);
            gain.connect(ctx.destination);
            src.start(time);
        });
    }

    function exportWavBuffer(audioBuffer) {
        const len = audioBuffer.length;
        const samples = audioBuffer.getChannelData(0);
        const sampleRate = audioBuffer.sampleRate;
        const wav = new ArrayBuffer(44 + len * 2);
        const view = new DataView(wav);

        function writeStr(offset, str) {
            for (let i = 0; i < str.length; i++) view.setUint8(offset + i, str.charCodeAt(i));
        }

        writeStr(0, 'RIFF');
        view.setUint32(4, 36 + len * 2, true);
        writeStr(8, 'WAVE');
        writeStr(12, 'fmt ');
        view.setUint32(16, 16, true); 
        view.setUint16(20, 1, true);  
        view.setUint16(22, 1, true); 
        view.setUint32(24, sampleRate, true);
        view.setUint32(28, sampleRate * 2, true);
        view.setUint16(32, 2, true);
        view.setUint16(34, 16, true);
        writeStr(36, 'data');
        view.setUint32(40, len * 2, true);

        for (let i = 0; i < len; i++) {
            const val = Math.max(-1, Math.min(1, samples[i])) * 0x7FFF;
            view.setInt16(44 + i * 2, val, true);
        }

        const uint8 = new Uint8Array(wav);
        let binary = "";
        for (let i = 0; i < uint8.length; i++) {
            binary += String.fromCharCode(uint8[i]);
        }

        return "data:audio/wav;base64," + btoa(binary);
    }



    function renderToWavBase64(midiData) {console.log("base64")
        scheduleOfflineMidi(midiData, offlineCtx, state.decodedNotes);
        console.log("base64")
        offlineCtx.startRendering().then(function(rendered){console.log("ok")
            const base64 = exportWavBuffer(rendered);
            load(base64)

        });
    }

    function play() {
        if (!state.buf || state.flag) return;
        var restart = state.marker > 0 ? state.marker : 0;
        state.origin = ctx.currentTime - restart;
        var pulse = ctx.createBufferSource();
        pulse.buffer = state.buf;
        pulse.connect(ctx.destination);
        pulse.onended = function () {
            state.flag = false;
            if (!state.stopped) state.marker = 0;
            state.stopped = false;
        };
        pulse.start(0, restart);
        state.node = pulse;
        state.flag = true;
    }

    function pause() {
        if (!state.flag || !state.node) return;
        state.stopped = true;
        state.marker = ctx.currentTime - state.origin;
        state.node.stop();
        state.flag = false;
    }
    function toggle(){
        if(state.flag) {
            pause();
        } else {
            play();
        }
    }

    function reset(t) {
        if (state.node) state.node.stop();
        state.marker = t || 0;
        state.flag = false;
    }

    function playNote(freq, velocity, dur, offset) {
        var available = Object.keys(state.decodedNotes).map(Number);
        if (!available.length) return;
        var closest = available.reduce((a, b) => Math.abs(b - freq) < Math.abs(a - freq) ? b : a);
        var buf = state.decodedNotes[closest];
        if (!buf) return;
        var pulse = ctx.createBufferSource();
        pulse.buffer = buf;
        pulse.playbackRate.value = Math.pow(2, (freq - closest) / 12);
        var gainNode = ctx.createGain();
        gainNode.gain.value = velocity;
        pulse.connect(gainNode);
        gainNode.connect(ctx.destination);
        state.node = pulse;
        pulse.start(offset);
        pulse.stop(ctx.currentTime + offset + dur);
    }

    
    function playMidi(midiData) {
        let notes = decodeMidi(midiData);
        notes.forEach(note => {
            playNote(note.midi, note.velocity, note.duration, note.time);
        });
    }

    if (ty === "base64") {
        load(input);
    } else if (ty === "piano") {
        loadNotes(function () {
            if (typeof onReady === "function") onReady();
        });
    }

    return {
        play,
        pause,
        reset,
        toggle,
        playNote,
        playMidi,
        renderToWavBase64,
    };
}



